import {useState, useEffect} from "react";
import UserItem from "./UserItem";

function UserList(props) {
  const [userList, setUserList] = useState(props.userList);

  const userItem = userList.map((item) => (
    <tr key={item.id}>
      <td>{item.id}</td>
      <td>{item.name}</td>
      <td>{item.year}</td>
    </tr>
  ));

  return (
    <div>
      <div>User List:</div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          <UserItem />
        </tbody>
      </table>
    </div>
  );
}

export default UserList;
